// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;
import "./User.sol";

contract Main {

    mapping(address => address) public users;    

    event user_added(string, address);
    event entering(string, address);
    event main_deployed(string);

    constructor(){
        emit main_deployed('Main is deployed');
    }


    // function register(string memory _name) public returns(User){

    //     emit entering(_name, msg.sender);

    //     require(bytes(_name).length != 0,"Name cannot be empty");

    //     //Create a new user
    //     User newUser = new User(_name);
    //     users[msg.sender] = address(newUser);

    //     emit user_added(_name, address(newUser));

    //     //Return the user
    //     return newUser;
    // }

    function register(string memory _word) public returns(SecondContract){
        emit entering(_word, msg.sender);

        SecondContract sec = new SecondContract(_word);
        users[msg.sender] = address(sec);

        emit user_added(_word, address(sec));

        return sec;
    }

}

contract SecondContract {

    string public word;
    event second_contract_created(string,address);

    constructor(string memory _word){
        word = _word;
        emit second_contract_created(_word,address(this));
    }

}
